INSERT INTO `v1_479e3c3fae60712a22965236dca94efb97b8cc21318b04309dd894100bb84b66` VALUES (120701, 1.84, 0, 0, 1, 120701, 0, 120701, 0, 1, 0, 0, 283, "2025/01/20 11:59:59", 4, "シェフィ（ニューイヤー）", "2025/01/15 15:00:00", 450, "【物理】前衛で、雪花舞う晴れ空をゆく新春氷竜少女。\nＵＢで顕現させる氷竜の牙で味方への強化スキルを高め\n自身の範囲攻撃技と共に苛烈な攻勢で敵陣を凍滅する。", 22, 120701, 3, "しぇふぃ", 1);
INSERT INTO `v1_479e3c3fae60712a22965236dca94efb97b8cc21318b04309dd894100bb84b66` VALUES (120801, 1.3, 0, 0, 2, 120801, 0, 120801, 0, 1, 0, 0, 193, "2030/12/31 15:00:00", 4, "ルカ（ニューイヤー）", "2023/10/16 15:00:00", 450, "【物理】前衛で雪月花の舞を納める新春の姉御。\n攻撃を当てる度に増加する【剣の刻印】でＵＢとスキルの\n威力を上昇させ、目にも止まらぬ斬撃で敵を圧倒する。", 22, 120801, 1, "るか", 1);
INSERT INTO `v1_479e3c3fae60712a22965236dca94efb97b8cc21318b04309dd894100bb84b66` VALUES (120901, 1.425, 0, 0, 12, 120901, 0, 120901, 0, 1, 0, 0, 424, "2025/01/20 11:59:59", 3, "イリヤ（ニューイヤー）", "2025/01/15 15:00:00", 450, "【魔法】中衛で自らの血を代償に力を振るう新春吸血鬼。\n自身のＨＰを消費して放つ強力なスキルと、敵からＴＰを\n吸収するスキルを自在に操り、目の前の敵を撃滅する。", 38, 120901, 3, "いりや", 2);
INSERT INTO `v1_479e3c3fae60712a22965236dca94efb97b8cc21318b04309dd894100bb84b66` VALUES (121001, 2.25, 0, 0, 1, 121001, 0, 121001, 0, 1, 0, 0, 164, "2025/02/24 11:59:59", 5, "ペコリーヌ（オーバーロード）", "2025/02/20 12:00:00", 450, "【物理】前衛で、仲間との絆を力に変え戦う腹ペコ王女。\n敵のＨＰ状態で永続の物理攻撃力上昇と、短時間の特大\n攻撃力上昇＆自己ＴＰ回復を使い分け戦況を一変させる。", 41, 121001, 3, "ぺこりーぬ", 1);
INSERT INTO `v1_479e3c3fae60712a22965236dca94efb97b8cc21318b04309dd894100bb84b66` VALUES (121101, 2.07, 0, 0, 1, 121101, 0, 121101, 0, 1, 0, 0, 588, "2025/02/24 11:59:59", 7, "キャル（オーバーロード）", "2025/02/20 12:00:00", 450, "【魔法】中衛で仲間との絆を力に変え戦うツンデレ猫娘。\n敵を妨害するスキルと、ＵＢで敵全体を恐慌状態にし既に\n恐慌状態の敵のＴＰをダウンさせ、全戦場を掌握する。", 42, 121101, 3, "きゃる", 2);
INSERT INTO `v1_479e3c3fae60712a22965236dca94efb97b8cc21318b04309dd894100bb84b66` VALUES (121201, 1.55, 0, 0, 6, 121201, 0, 121201, 0, 1, 0, 0, 260, "2030/12/31 15:00:00", 4, "ラビリスタ（オーバーロード）", "2023/11/16 15:00:00", 450, "【物理】前衛で世界の理をすべて見つめる『迷宮女王』。\n味方を攻撃面で強化し、継続ＨＰ回復を全体に付与する\nスキルで戦線を整え、自身も圧倒的な力で敵を殲滅する。", 40, 121201, 1, "らびりすた", 1);
INSERT INTO `v1_479e3c3fae60712a22965236dca94efb97b8cc21318b04309dd894100bb84b66` VALUES (121301, 1.9, 0, 0, 3, 121301, 0, 121301, 0, 0, 0, 0, 731, "2030/12/31 15:00:00", 3, "クルミ（ステージ）", "2022/03/03 19:00:00", 450, "【物理】後衛で、皆のため意を決し奮起する小さな女優。\n残りＨＰが多いほど物理攻撃力がアップし、物理攻撃無効\nバリアのスキルやＨＰ・ＴＰ継続回復で味方を支援する。", 3, 121301, 3, "くるみ", 1);
INSERT INTO `v1_479e3c3fae60712a22965236dca94efb97b8cc21318b04309dd894100bb84b66` VALUES (121401, 2.27, 0, 0, 15, 121401, 0, 121401, 0, 0, 0, 0, 742, "2030/12/31 15:00:00", 7, "ミサキ（ステージ）", "2022/03/15 15:00:00", 450, "【魔法】後衛で後ろの味方を強化する魔法少女の看板娘。\n後衛の味方をバリアとＴＰ継続回復で支援し、自分の魔法\n攻撃力に応じ強化される攻撃力アップスキルで鼓舞する。", 7, 121401, 3, "みさき", 2);
INSERT INTO `v1_479e3c3fae60712a22965236dca94efb97b8cc21318b04309dd894100bb84b66` VALUES (121501, 2.0, 0, 0, 12, 121501, 0, 121501, 0, 1, 0, 0, 590, "2025/04/30 11:59:59", 6, "アユミ（怪盗）", "2025/04/26 12:00:00", 450, "【物理】中衛で、闇夜に身を潜める神出鬼没の怪盗少女。\n敵の目の前から姿を消す隠密スキルや、遠くの敵に対する\nＴＰダウンスキルを駆使して、敵陣後方から瓦解させる。", 6, 121501, 3, "あゆみ", 1);
INSERT INTO `v1_479e3c3fae60712a22965236dca94efb97b8cc21318b04309dd894100bb84b66` VALUES (121601, 1.425, 0, 0, 17, 121601, 0, 121601, 0, 0, 0, 0, 292, "2030/12/31 15:00:00", 3, "イノリ（怪盗）", "2022/04/15 15:00:00", 450, "【物理】前衛で闇に紛れ会心の一撃を放つ怪盗ドラゴン。\n隠密効果中、ダメージが大アップし必ずクリティカルする\nＵＢとスキルを駆使し安定したダメージを敵に叩き込む。", 3, 121601, 3, "いのり", 1);
INSERT INTO `v1_479e3c3fae60712a22965236dca94efb97b8cc21318b04309dd894100bb84b66` VALUES (121701, 0.0, 0, 0, 0, 121701, 0, 0, 180901, 1, 1, 0, 421, "2030/12/31 15:00:00", 0, "アキノ（アキノ＆サレン）", "2015/04/01 15:00:00", 0, "", 0, 0, 3, "あきの", 0);
