INSERT INTO `v1_479e3c3fae60712a22965236dca94efb97b8cc21318b04309dd894100bb84b66` VALUES (131501, 0.0, 0, 0, 0, 131501, 0, 0, 0, 1, 1, 0, 0, "2030/12/31 15:00:00", 1, "プレシア", "2015/04/01 15:00:00", 0, "", 1, 0, 3, "ぷれしあ", 0);
INSERT INTO `v1_479e3c3fae60712a22965236dca94efb97b8cc21318b04309dd894100bb84b66` VALUES (131601, 1.92, 0, 0, 0, 131601, 0, 131601, 0, 1, 0, 0, 399, "2025/01/15 14:59:59", 4, "リリ（サマー）", "2025/01/09 12:00:00", 450, "【物理】中衛で、夏の陽光のもと研鑽する妹系大和撫子。\n防御力アップに加えバリアやＨＰ回復で味方の守りを固め\nＴＰ回復や攻撃力ダウンをも巧みに操り、場を支配する。", 4, 131601, 3, "りり", 1);
INSERT INTO `v1_479e3c3fae60712a22965236dca94efb97b8cc21318b04309dd894100bb84b66` VALUES (131701, 1.92, 0, 0, 0, 131701, 0, 131701, 0, 1, 0, 0, 743, "2025/02/15 14:59:59", 44, "アメス（サマー）", "2025/02/10 12:00:00", 450, "【魔法】後衛で、黄昏の水面に舞い降りる水着姿の妖精。\n行動速度アップやＴＰ支援をはじめとした多数のサポート\nを施しつつ、ＵＢの攻防弱体化で清爽に勝利へと導く。", 53, 131701, 3, "あめす", 2);
INSERT INTO `v1_479e3c3fae60712a22965236dca94efb97b8cc21318b04309dd894100bb84b66` VALUES (131801, 2.09, 0, 0, 0, 131801, 0, 131801, 0, 0, 0, 0, 709, "2030/12/31 15:00:00", 7, "ホマレ（サマー）", "2024/08/15 15:00:00", 450, "【魔法】後衛で夏の清涼に翼を休める水着姿の龍の首領。\n攻防弱体化に加え、ステータスダウン付与のたび増加する\n【日食】の数に応じたダメージで、抗う全てを灰に帰す。", 21, 131801, 3, "ほまれ", 2);
INSERT INTO `v1_479e3c3fae60712a22965236dca94efb97b8cc21318b04309dd894100bb84b66` VALUES (131901, 2.09, 0, 0, 0, 131901, 0, 131901, 0, 1, 1, 0, 725, "2030/12/31 15:00:00", 7, "エミリア（サマー）", "2024/08/31 12:00:00", 450, "【魔法】後衛で、パックと共に戦う真夏のハーフエルフ。\n氷壁を生成するスキルや、強力なダメージと速度ダウンを\n付与するユニオンバーストで、敵の侵攻を食い止める。", 23, 131901, 1, "えみりあ", 2);
INSERT INTO `v1_479e3c3fae60712a22965236dca94efb97b8cc21318b04309dd894100bb84b66` VALUES (132001, 2.09, 0, 0, 0, 132001, 0, 132001, 0, 1, 0, 0, 775, "2024/09/25 11:59:59", 7, "エキドナ（サマー）", "2024/09/13 12:00:00", 450, "【魔法】後衛で未知の世界との邂逅に胸躍る強欲の魔女。\n鮮烈な攻撃魔法をはじめ、味方への攻撃支援、敵の弱体化\nから自己蘇生まで、あらゆる魔法を振るい、欲を満たす。", 21, 132001, 3, "えきどな", 2);
INSERT INTO `v1_479e3c3fae60712a22965236dca94efb97b8cc21318b04309dd894100bb84b66` VALUES (132101, 2.09, 0, 0, 0, 132101, 0, 132101, 0, 1, 0, 0, 146, "2024/09/13 11:59:59", 13, "レム（サマー）", "2024/08/31 12:00:00", 450, "【物理】前衛で夏の日差しの中、余暇を楽しむ双子の妹。\nＵＢで鬼族の力を解放すると攻防両面に加えＨＰ吸収が\n上昇し、目に映る全てを【狂騒】のままに叩き伏せる。", 24, 132101, 3, "れむ", 1);
INSERT INTO `v1_479e3c3fae60712a22965236dca94efb97b8cc21318b04309dd894100bb84b66` VALUES (132201, 1.84, 0, 0, 0, 132201, 0, 132201, 0, 1, 0, 0, 721, "2025/05/15 14:59:59", 7, "ノゾミ（アルケミスト）", "2025/05/03 19:00:00", 450, "【魔法】後衛で、希望を錬成するアルケミストアイドル。\n【錬金素材】から【パフューム】を創り、ダメージに加え\nＴＰ回復や攻撃支援能力を向上させて勝利の香りを運ぶ。", 7, 132201, 3, "のぞみ", 2);
INSERT INTO `v1_479e3c3fae60712a22965236dca94efb97b8cc21318b04309dd894100bb84b66` VALUES (132301, 2.09, 0, 0, 0, 132301, 0, 132301, 0, 1, 0, 0, 754, "2025/05/15 14:59:59", 7, "ルイズマリー", "2025/05/03 19:00:00", 450, "【魔法】後衛で、底知れぬ叡智を秘めた天才錬金術師。\n高い方の防御力でダメージを受ける調和状態を付与し、\n２回まで性能が上昇していくＵＢで、妄想を爆発させる。", 7, 132301, 3, "るいずまりー", 2);
INSERT INTO `v1_479e3c3fae60712a22965236dca94efb97b8cc21318b04309dd894100bb84b66` VALUES (132801, 2.09, 0, 0, 0, 132801, 0, 132801, 0, 1, 0, 0, 750, "2024/12/09 11:59:59", 7, "ライラエル（クリスマス）", "2024/11/30 12:00:00", 450, "【魔法】後衛で、雪白の肌を黒衣に包んだ甘美なる姫君。\n味方のＨＰを代償に強力なバリアを展開しつつ、バリアを\n起点とした高出力の二連撃で、聖夜の大樹に灯を点す。", 0, 132801, 3, "らいらえる", 2);
INSERT INTO `v1_479e3c3fae60712a22965236dca94efb97b8cc21318b04309dd894100bb84b66` VALUES (132901, 2.09, 0, 0, 0, 132901, 0, 132901, 0, 0, 0, 0, 748, "2030/12/31 15:00:00", 5, "イオ（クリスマス）", "2024/12/09 12:00:00", 450, "【魔法】後衛で、心地良い眠りの中に訪れる聖夜の悪魔。\n最も魔法攻撃力が高い味方に【悪魔の口づけ】を付与し、\n攻撃支援とＴＰ回復による付きっきりの手ほどきをする。", 46, 132901, 3, "いお", 2);
INSERT INTO `v1_479e3c3fae60712a22965236dca94efb97b8cc21318b04309dd894100bb84b66` VALUES (133001, 2.09, 0, 0, 0, 133001, 0, 133001, 0, 1, 0, 0, 234, "2025/05/03 18:59:59", 0, "グレイス", "2025/04/30 12:00:00", 450, "【物理】前衛で、宙を舞うように戦う幽霊の守護騎士。\nＵＢで味方の攻撃と速度支援を行い、【レイスボディ】で\n敵の目を逃れ、不意を突く一撃で永遠の眠りにつかせる。", 0, 133001, 3, "ぐれいす", 1);
INSERT INTO `v1_479e3c3fae60712a22965236dca94efb97b8cc21318b04309dd894100bb84b66` VALUES (133101, 1.75, 0, 0, 0, 133101, 0, 133101, 0, 1, 0, 0, 154, "2025/05/03 18:59:59", 0, "ヴァイオレット", "2025/04/30 12:00:00", 450, "【物理】前衛で、儚くも凛と咲くジオ・ニヴルヘルの姫。\n継続ダメージ効果を鈍化させる環境効果【忌火】で盾に、\n絶怠霊度の継続割合攻撃で矛となり、静寂の冥府を護る。", 0, 133101, 3, "うぁいおれっと", 1);
INSERT INTO `v1_479e3c3fae60712a22965236dca94efb97b8cc21318b04309dd894100bb84b66` VALUES (133201, 2.09, 0, 0, 0, 133201, 0, 133201, 0, 1, 1, 0, 296, "2030/12/31 15:00:00", 4, "モニカ（ニューイヤー）", "2024/12/31 12:00:00", 450, "【物理】前衛で、元日も元気にはしゃぎまわる軍人少女。\n与ダメージに応じて追加効果が強化されるＵＢと、発動ご\nとに成長する自己強化スキルで秩序を乱す者の目を回す。", 22, 133201, 1, "もにか", 1);
INSERT INTO `v1_479e3c3fae60712a22965236dca94efb97b8cc21318b04309dd894100bb84b66` VALUES (133501, 2.09, 0, 0, 0, 133501, 0, 133501, 0, 1, 0, 0, 718, "2025/01/15 14:59:59", 4, "サレン（ニューイヤー）", "2025/01/03 19:00:00", 450, "【魔法】後衛で、傍らで心を重ねる振袖姿の救護院の主。\n味方へのＴＰ回復の支援をしつつ、味方がＵＢを発動する\nたびダメージが上がるスキルで、共に困難を乗り越える。", 22, 133501, 3, "されん", 2);
INSERT INTO `v1_479e3c3fae60712a22965236dca94efb97b8cc21318b04309dd894100bb84b66` VALUES (133601, 2.09, 0, 0, 0, 133601, 0, 133601, 0, 1, 0, 0, 445, "2025/01/31 11:59:59", 0, "メドゥーサ", "2025/01/20 12:00:00", 450, "【物理】中衛で眷属と力を合わせて戦う誇り高き蛇乙女。\n【魔眼】の数に応じて効果量が上がるスキルのダメージと\n弱体化で範囲内の敵を追い詰め、鋭い瞳で石へと変える。", 0, 133601, 3, "めどぅーさ", 1);
INSERT INTO `v1_479e3c3fae60712a22965236dca94efb97b8cc21318b04309dd894100bb84b66` VALUES (133701, 2.09, 0, 0, 0, 133701, 0, 133701, 0, 1, 0, 0, 717, "2025/02/10 11:59:59", 8, "ラビリスタ（アルファ）", "2025/01/31 12:00:00", 450, "【魔法】後衛で、始原の冠装を使いこなす『迷宮女王』。\n水属性の味方のＴＰ上昇を増加する領域を作り、連射攻撃\nで敵の防御を撃ち抜くことで七冠の力を敵に知らしめる。", 0, 133701, 3, "らびりすた", 2);
INSERT INTO `v1_479e3c3fae60712a22965236dca94efb97b8cc21318b04309dd894100bb84b66` VALUES (133801, 2.09, 0, 0, 0, 133801, 0, 133801, 0, 1, 0, 0, 759, "2025/02/28 11:59:59", 7, "ネネカ（アルファ）", "2025/02/20 12:00:00", 450, "【魔法】後衛から、始原の姿で戦況を操る『変貌大妃』。\n召喚したグレゴールから攻撃支援とＴＰ回復を受け、互い\nの魔力を合わせた連携攻撃で、幽玄なる玉座に君臨する。", 0, 133801, 3, "ねねか", 2);
INSERT INTO `v1_479e3c3fae60712a22965236dca94efb97b8cc21318b04309dd894100bb84b66` VALUES (133901, 2.09, 0, 0, 0, 133901, 0, 133901, 0, 1, 0, 0, 228, "2025/02/20 11:59:59", 6, "クリスティーナ（アルファ）", "2025/02/10 12:00:00", 450, "【物理】前衛で、始原の冠装の力を振るう『誓約女君』。\n10行動目に攻撃力を大幅アップし、スキルに追撃を発生\nさせる【虚数】を得て隔絶した力で楯突く敵を抹消する。", 0, 133901, 3, "くりすてぃーな", 1);
INSERT INTO `v1_479e3c3fae60712a22965236dca94efb97b8cc21318b04309dd894100bb84b66` VALUES (134001, 2.09, 0, 0, 0, 134001, 0, 134001, 0, 1, 0, 0, 746, "2025/05/03 18:59:59", 0, "フィオ", "2025/04/30 12:00:00", 450, "【魔法】後衛で、アストルムの冒険へと導くガイド妖精。\nバフとバリアで味方を護りバリアを起点とする攻撃支援、\n風属性の味方への行動速度とＴＰの支援で仲間を支える。", 0, 134001, 3, "ふぃお", 2);
INSERT INTO `v1_479e3c3fae60712a22965236dca94efb97b8cc21318b04309dd894100bb84b66` VALUES (134101, 0.0, 0, 0, 0, 134101, 0, 0, 0, 1, 0, 0, 0, "2030/12/31 15:00:00", 5, "フブキ", "2015/04/01 15:00:00", 0, "", 1, 0, 3, "ふぶき", 0);
INSERT INTO `v1_479e3c3fae60712a22965236dca94efb97b8cc21318b04309dd894100bb84b66` VALUES (134201, 0.0, 0, 0, 0, 134201, 0, 0, 0, 1, 0, 0, 0, "2030/12/31 15:00:00", 7, "ライラエル（クリスマス）", "2015/04/01 15:00:00", 0, "", 1, 0, 3, "らいらえる", 0);
INSERT INTO `v1_479e3c3fae60712a22965236dca94efb97b8cc21318b04309dd894100bb84b66` VALUES (134301, 2.09, 0, 0, 0, 134301, 0, 134301, 0, 1, 0, 0, 778, "2025/03/15 14:59:59", 7, "ランファ（儀装束）", "2025/03/03 19:00:00", 450, "【魔法】後衛で儀装束を纏い精霊と心を通わせる唱喚士。\n敵の数に応じてダメージ量が変化する範囲攻撃や、魔法\n無効バリアなどの支援スキルで想いを詩に乗せ響かせる。", 0, 134301, 3, "らんふぁ", 2);
INSERT INTO `v1_479e3c3fae60712a22965236dca94efb97b8cc21318b04309dd894100bb84b66` VALUES (134401, 2.09, 0, 0, 0, 134401, 0, 134401, 0, 0, 0, 0, 773, "2030/12/31 15:00:00", 7, "チカ（儀装束）", "2025/03/15 15:00:00", 450, "【魔法】後衛で儀装束を纏い歌を紡ぎ伝えていく唱喚士。\n自分と最も近くの味方へ強力なバフとＴＰ回復を行うこと\nで攻撃を支援し、共に心を通わせ美しき旋律を奏でる。", 21, 134401, 3, "ちか", 2);
INSERT INTO `v1_479e3c3fae60712a22965236dca94efb97b8cc21318b04309dd894100bb84b66` VALUES (134501, 2.09, 0, 0, 0, 134501, 0, 134501, 0, 1, 0, 0, 719, "2025/04/15 14:59:59", 0, "クローチェ（エアリアル）", "2025/04/08 12:00:00", 450, "【魔法】後衛で超速飛行からの大火力を叩き込むロボ娘。\n上空から速度バフで味方全体を支援しつつ、自分のバリア\nを解除して力へと変え、世界の命運を背負い飛翔する！", 0, 134501, 3, "くろーちぇ", 2);
INSERT INTO `v1_479e3c3fae60712a22965236dca94efb97b8cc21318b04309dd894100bb84b66` VALUES (134601, 2.09, 0, 0, 0, 134601, 0, 134601, 0, 1, 0, 0, 526, "2025/04/08 11:59:59", 35, "アオイ（パイロット）", "2025/03/31 12:00:00", 450, "【物理】中衛で巨大ロボを駆り戦うぼっちのパイロット。\n敵の弱体化や、味方へバリアを展開するスキルを持ち、\n鋼鉄の乙女から放つ光線はいかに堅固な守りも打ち破る。", 35, 134601, 3, "あおい", 1);
INSERT INTO `v1_479e3c3fae60712a22965236dca94efb97b8cc21318b04309dd894100bb84b66` VALUES (134701, 2.09, 0, 0, 0, 134701, 0, 134701, 0, 1, 0, 0, 490, "2025/04/26 11:59:59", 7, "ホウオウ", "2025/04/15 15:00:00", 450, "【物理】中衛で、華麗に舞い踊る五色絢爛な煉華の鳳凰。\n攻撃力バフやバリア展開などの攻防支援と、多彩で豊富な\nＨＰ・ＴＰ供給を両立し、浄化の力で皆に安寧を授ける。", 7, 134701, 3, "ほうおう", 1);
INSERT INTO `v1_479e3c3fae60712a22965236dca94efb97b8cc21318b04309dd894100bb84b66` VALUES (136601, 0.0, 0, 0, 0, 136601, 0, 0, 0, 0, 0, 0, 0, "2030/12/31 15:00:00", 1, "メドゥーサ", "2015/04/01 15:00:00", 0, "", 1, 0, 1, "めどぅーさ", 0);
